import React, {useState} from "react"
import { useForm } from "react-hook-form";
import { useAuth } from "../commons/auth/auth-context";

function Admin() {

  const {token} = useAuth();
  
  
  let login = document.getElementById('login');
 if(login!=null){
  login.innerHTML=""  
  login.parentNode.removeChild(login);
 //getSolicitudes();
}
 return(
 <React.Fragment>
 <h1>Admin Page</h1>
 <fieldset></fieldset>
 </React.Fragment>)
}
export {Admin};
